import { Box } from "@mui/system";

const App = () => (
  <BrowserRouter>
    <Box sx={{ backgroundColor: "#000" }}>
      <Navbar />
      <Routes>
          <Route path="/" />


      </Routes>
    </Box>
  </BrowserRouter>
);

export default App;
